// SPDX-License-Identifier: GPL-2.0-or-later

pragma solidity >= 0.7.6;
pragma abicoder v2;


import '@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol';
import '@uniswap/v3-core/contracts/interfaces/IUniswapV3Factory.sol';
import '@uniswap/v3-core/contracts/libraries/TickMath.sol';
import '@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol';
import '@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol';
import '@uniswap/v3-periphery/contracts/interfaces/INonfungiblePositionManager.sol';
import '@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol';
import '@uniswap/v3-periphery/contracts/base/LiquidityManagement.sol';



contract PositionManager is IERC721Receiver, LiquidityManagement {

    uint24 constant poolFee = 3000; //default to 0.3% Uni Pools

    INonfungiblePositionManager public immutable nonfungiblePositionManager;

    address constant private v3FactoryAddress = address(0x1F98431c8aD98523631AE4a59f267346ea31F984);

    event orderCreated(
        address token0,
        address token1,
        bool side,
        uint160 sqrtPriceX96,
        uint256 quantity,

        int24 tickLower,
        int24 tickUpper,
        uint256 amount0,
        uint256 amount1
    );

    IUniswapV3Factory constant v3Factory = IUniswapV3Factory(v3FactoryAddress);

    struct Pair {
        address token0;
        address token1;
    }

    struct Order {
        Pair pair;
        bool side; //true = buy token1 for token0, false = buy token0 for token1
        uint160 sqrtPriceX96; // Uniswap pool price 
        uint256 quantity;
    }

    //Tracks effective UniLP deposits
    struct Deposit {
        address owner;
        uint128 liquidity;
        address token0;
        address token1;

    }

    // Our constructor hard codes the address of the nonfungible position manager 
    // interface, V3 router, and the periphery immutable state constructor, which 
    // requires the factory and the address of weth9 (the ERC-20 wrapper for ether).

    constructor(
        //INonfungiblePositionManager _nonfungiblePositionManager,
        //address _factory,
        //address _WETH9
    ) PeripheryImmutableState(
        v3FactoryAddress, 
        address(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2)
      ) {
        //nonfungiblePositionManager = _nonfungiblePositionManager;
        nonfungiblePositionManager = INonfungiblePositionManager(address(0xC36442b4a4522E871399CD717aBDD847Ab11FE88));
    }

    mapping(uint256 => Deposit) public deposits;


    /// @notice Calls the mint function defined in periphery to mint a new position to the contract on behalf of the user
    /// @return tokenId The id of the newly minted ERC721
    /// @return liquidity The amount of liquidity for the position
    /// @return amount0 The amount of token0
    /// @return amount1 The amount of token1
    function mintNewPosition(
        address _token0,
        uint256 _amount0,
        address _token1,
        uint256 _amount1,
        int24 _tickLower, 
        int24 _tickUpper,
        address _recipient
    )
        private
        returns (
            uint256 tokenId,
            uint128 liquidity,
            uint256 amount0,
            uint256 amount1
        )
    {

        // Approve the Uniswap position manager
        TransferHelper.safeApprove(_token0, address(nonfungiblePositionManager), _amount0);
        TransferHelper.safeApprove(_token1, address(nonfungiblePositionManager), _amount1);


        INonfungiblePositionManager.MintParams memory params =
            INonfungiblePositionManager.MintParams({
                token0: _token0,
                token1: _token1,
                fee: poolFee,
                tickLower: _tickLower,
                tickUpper: _tickUpper,
                amount0Desired: _amount0,
                amount1Desired: _amount1,
                amount0Min: 0,
                amount1Min: 0,
                recipient: address(this),
                deadline: block.timestamp
            });

        // Note that the pool must already be created and initialized in order to mint
        (tokenId, liquidity, amount0, amount1) = nonfungiblePositionManager.mint(params);

        // Create a deposit in our db
        _createDeposit(_recipient, tokenId);

        // Remove allowance and refund in both assets.
        if (amount0 < _amount0) {
            TransferHelper.safeApprove(_token0, address(nonfungiblePositionManager), 0);
            uint256 refund0 = _amount0 - amount0;
            TransferHelper.safeTransfer(_token0, msg.sender, refund0);
        }

        if (amount1 < _amount1) {
            TransferHelper.safeApprove(_token1, address(nonfungiblePositionManager), 0);
            uint256 refund1 = _amount1 - amount1;
            TransferHelper.safeTransfer(_token1, msg.sender, refund1);
        }

    }

    /// @notice creates a limit order by minting a new single sided liquidity position on uniswap

    function createLimitOrder(Order calldata _order)
    public
    returns (
        uint256 amount0,
        uint256 amount1,
        int24 tickUpper,
        int24 tickLower
    )
    {
        // identify target pool: we always choose the 0.3% fee pool
        IUniswapV3Pool pool = IUniswapV3Pool(v3Factory.getPool(_order.pair.token0, _order.pair.token1, poolFee));

        //get current pool price and tick
        (uint160 sqrtPriceX96, int24 poolTick,,,,,) =  pool.slot0();

        // verify that price is higher/lower 
        require(
            _order.side ? _order.sqrtPriceX96 < sqrtPriceX96 : _order.sqrtPriceX96 > sqrtPriceX96
            , "OOB" //out of bounds
        );

        //int24 tickUpper;
        //int24 tickLower;
        int24 positionTick = TickMath.getTickAtSqrtRatio(_order.sqrtPriceX96);

        //additional safety check that tick is not identical to current pool tick
        require(
            _order.side ? positionTick < poolTick : positionTick > poolTick,
            "Position tick OOB" //position tick out of bounds
        );

        // converts price into tick range
        if (_order.side) {
            tickUpper = positionTick;
            tickLower = tickUpper - 1;
        }
        else {
            tickLower = positionTick;
            tickUpper = tickLower + 1;
        }

        require(tickUpper <= TickMath.MAX_TICK, 'Tick Out of range');
        require(tickLower >= TickMath.MIN_TICK, 'Tick Out of range');

        amount0 = _order.side ? _order.quantity : 0 ;
        amount1 = _order.side ? 0 : _order.quantity ;



        // PositionManager Creates position
        mintNewPosition(
            _order.pair.token0,
            amount0,
            _order.pair.token1,
            amount1,
            tickLower,
            tickUpper,
            msg.sender
        );

        emit orderCreated(
            _order.pair.token0,
            _order.pair.token1,
            _order.side,
            _order.sqrtPriceX96,
            _order.quantity,

            tickLower,
            tickUpper,
            amount0,
            amount1
        );
    }



    function _createDeposit(address owner, uint256 tokenId) internal {
        (, , address token0, address token1, , , , uint128 liquidity, , , , ) =
            nonfungiblePositionManager.positions(tokenId);

        // set the owner and data for position
        // operator is msg.sender
        deposits[tokenId] = Deposit({owner: owner, liquidity: liquidity, token0: token0, token1: token1});
    }

    //fallback function upon sending a Uni Position to the contract? 
    function onERC721Received(
        address operator,
        address,
        uint256 tokenId,
        bytes calldata
    ) external override returns (bytes4) {
        // get position information
        _createDeposit(operator, tokenId);
        return this.onERC721Received.selector;
    }


    /// @notice Transfers funds to owner of NFT
    /// @param tokenId The id of the erc721
    /// @param amount0 The amount of token0
    /// @param amount1 The amount of token1
    function _sendToOwner(
        uint256 tokenId,
        uint256 amount0,
        uint256 amount1
    ) internal {
        // get owner of contract
        address owner = deposits[tokenId].owner;

        address token0 = deposits[tokenId].token0;
        address token1 = deposits[tokenId].token1;
        // send collected fees to owner
        TransferHelper.safeTransfer(token0, owner, amount0);
        TransferHelper.safeTransfer(token1, owner, amount1);
    }

    function _sendTo(
        uint256 tokenId,
        uint256 amount0, 
        uint256 amount1,
        address recipient
    ) internal {

        address token0 = deposits[tokenId].token0;
        address token1 = deposits[tokenId].token1;
        // send collected fees to owner
        TransferHelper.safeTransfer(token0, recipient, amount0);
        TransferHelper.safeTransfer(token1, recipient, amount1);
    }

    /// @notice Collects the fees associated with provided liquidity
    /// @dev The contract must hold the erc721 token before it can collect fees
    /// @param tokenId The id of the erc721 token
    /// @return amount0 The amount of fees collected in token0
    /// @return amount1 The amount of fees collected in token1
    function collectAllFees(
        uint256 tokenId,
        address recipient
    ) external returns (uint256 amount0, uint256 amount1) {
        // Caller must own the ERC721 position
        // Call to safeTransfer will trigger `onERC721Received` which must return the selector else transfer will fail
        nonfungiblePositionManager.safeTransferFrom(msg.sender, address(this), tokenId);

        // set amount0Max and amount1Max to uint256.max to collect all fees
        // alternatively can set recipient to msg.sender and avoid another transaction in `sendToOwner`
        INonfungiblePositionManager.CollectParams memory params =
            INonfungiblePositionManager.CollectParams({
                tokenId: tokenId,
                recipient: address(this),
                amount0Max: type(uint128).max,
                amount1Max: type(uint128).max
            });

        (amount0, amount1) = nonfungiblePositionManager.collect(params);

        // send collected feed back to owner
        _sendTo(tokenId, amount0, amount1, recipient);
    }

    /// @notice A function that decreases the current liquidity by half. An example to show how to call the `decreaseLiquidity` function defined in periphery.
    /// @param tokenId The id of the erc721 token
    /// @return amount0 The amount received back in token0
    /// @return amount1 The amount returned back in token1
    function decreaseLiquidity(uint256 tokenId, uint128 _decreaseBy) external returns (uint256 amount0, uint256 amount1) {

        // caller must be the owner of the NFT
        // require(msg.sender == deposits[tokenId].owner, "Not the owner");
        // get liquidity data for tokenId
        // uint128 liquidity = deposits[tokenId].liquidity;

        // amount0Min and amount1Min are price slippage checks
        // if the amount received after burning is not greater than these minimums, transaction will fail
        INonfungiblePositionManager.DecreaseLiquidityParams memory params =
            INonfungiblePositionManager.DecreaseLiquidityParams({
                tokenId: tokenId,
                liquidity: _decreaseBy,
                amount0Min: 0,
                amount1Min: 0,
                deadline: block.timestamp
            });

        (amount0, amount1) = nonfungiblePositionManager.decreaseLiquidity(params);

        //send liquidity back to owner
        _sendToOwner(tokenId, amount0, amount1);
    }

    /// @notice Increases liquidity in the current range
    /// @dev Pool must be initialized already to add liquidity
    /// @param tokenId The id of the erc721 token
    /// @param amount0 The amount to add of token0
    /// @param amount1 The amount to add of token1
    function increaseLiquidityCurrentRange(
        uint256 tokenId,
        uint256 amountAdd0,
        uint256 amountAdd1
    )
        external
        returns (
            uint128 liquidity,
            uint256 amount0,
            uint256 amount1
        )
    {
        INonfungiblePositionManager.IncreaseLiquidityParams memory params =
            INonfungiblePositionManager.IncreaseLiquidityParams({
                tokenId: tokenId,
                amount0Desired: amountAdd0,
                amount1Desired: amountAdd1,
                amount0Min: 0,
                amount1Min: 0,
                deadline: block.timestamp
            });

        (liquidity, amount0, amount1) = nonfungiblePositionManager.increaseLiquidity(params);
    }


    /// @dev Returns the pool for the given token pair and fee. The pool contract may or may not exist. 
    /// source: Uniswap repo
    function getPool(
        address tokenA,
        address tokenB
    ) public pure returns (IUniswapV3Pool) {
        return IUniswapV3Pool(PoolAddress.computeAddress(v3FactoryAddress, PoolAddress.getPoolKey(tokenA, tokenB, poolFee)));
    }

